--
-- TOC entry 252 (class 1259 OID 17953)
-- Name: v_finding_list; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_finding_list AS
 SELECT row_number() OVER () AS no,
    trf.uuid AS finding_id,
        CASE
            WHEN (trf.finding_mv_id IS NOT NULL) THEN 'MV'::text
            WHEN (trf.finding_henkaten_id IS NOT NULL) THEN 'H'::text
            WHEN (trf.finding_ft_id IS NOT NULL) THEN 'FT'::text
            ELSE 'Obs'::text
        END AS source_category,
    tml.uuid AS line_id,
    tml.line_nm,
    tro.uuid AS observation_id,
    trmv.uuid AS finding_mv_id,
    tbrrf.uuid AS result_finding_id,
    trf.finding_date,
    trf.finding_location,
    trf.finding_desc,
    trf.cm_desc,
    trf.cm_priority,
    tmf.uuid AS factor_id,
    tmf.factor_nm,
    tmu.uuid AS cm_pic_id,
    trf.cm_str_plan_date,
    date_part('week'::text, trf.cm_str_plan_date) AS w_str_plan_date,
    trf.cm_end_plan_date,
    date_part('week'::text, trf.cm_end_plan_date) AS w_end_plan_date,
    trf.cm_str_act_date,
    date_part('week'::text, trf.cm_str_act_date) AS w_str_act_date,
    trf.cm_end_act_date,
    date_part('week'::text, trf.cm_end_act_date) AS w_end_act_date,
    trf.cm_judg,
    trf.file_pinksheet,
    trf.cm_comments,
        CASE
            WHEN ((trf.cm_str_plan_date < CURRENT_DATE) AND ((trf.cm_judg = false) OR (trf.cm_judg IS NULL))) THEN 'remain'::text
            WHEN ((trf.cm_judg = false) OR (trf.cm_judg IS NULL)) THEN 'problem'::text
            WHEN (trf.cm_judg = true) THEN 'closed'::text
            ELSE NULL::text
        END AS status_finding,
    trft.uuid AS finding_ft_id,
    trh.uuid AS finding_henkaten_id,
    tbrrf.uuid AS finding_obs_id,
    (((tmu.noreg)::text || '-'::text) || (tmu.fullname)::text) AS cm_pic_nm,
    trf.deleted_dt,
    trf.deleted_by,
    tmg.uuid AS group_id,
    tmg.group_nm,
    trf.finding_img,
    trf.cm_sign_lh_red,
    trf.cm_sign_lh_white,
    trf.cm_sign_sh,
        CASE
            WHEN ((trf.cm_str_plan_date < CURRENT_DATE) AND ((trf.cm_judg = false) OR (trf.cm_judg IS NULL))) THEN 'DELAY'::text
            WHEN ((trf.cm_judg = false) OR (trf.cm_judg IS NULL)) THEN 'PROGRESS'::text
            WHEN (trf.cm_judg = true) THEN 'DONE'::text
            ELSE NULL::text
        END AS status_check
   FROM (((((((((((public.tb_r_findings trf
     LEFT JOIN public.tb_r_result_findings tbrrf ON ((tbrrf.result_finding_id = trf.finding_obs_id)))
     JOIN public.tb_m_factors tmf ON ((tmf.factor_id = trf.factor_id)))
     JOIN public.tb_m_users tmu ON ((tmu.user_id = trf.cm_pic_id)))
     LEFT JOIN public.tb_m_groups tmg ON ((tmu.group_id = tmg.group_id)))
     LEFT JOIN public.tb_r_obs_results tror ON ((tror.obs_result_id = tbrrf.obs_result_id)))
     LEFT JOIN public.tb_r_observations tro ON ((tro.observation_id = tror.observation_id)))
     LEFT JOIN public.tb_m_pos tmp ON ((tmp.pos_id = tro.pos_id)))
     LEFT JOIN public.tb_r_member_voice trmv ON ((trmv.mv_id = trf.finding_mv_id)))
     LEFT JOIN public.tb_r_focus_theme trft ON ((trft.ft_id = trf.finding_ft_id)))
     LEFT JOIN public.tb_r_henkaten trh ON ((trh.henkaten_id = trf.finding_henkaten_id)))
     LEFT JOIN public.tb_m_lines tml ON ((tml.line_id = trf.line_id)));


ALTER TABLE public.v_finding_list OWNER TO postgres;

